うっかり日焼けしやすい手肌のために生まれた、UVカット機能付きの<BR>ハンドクリーム。手洗い後などにこまめに塗るだけで、紫外線から<BR>守りながらしっかり保湿。年齢の出やすい手肌をケアします。<BR>腕や首、デコルテ、脚にも使用可能です。<BR><BR>
